snippet.description:
In the campaign video, Camila Cabello is joined by fellow L'Oréal Paris spokespeople Aja Naomi King, Amber Heard, Julianne Moore, and Eva Longoria, who all reveal what happened in their lives when they stopped waiting and started, living, taking action, and creating opportunities for themselves.

After the commercial debut (during the Golden Globes), the brand is inviting people to share their own #StopWaiting stories on social media, and select posts will be re-shared on the L'Oréal Paris Twitter page.

@L'Oréal Paris USA

